 // Sketchfab Viewer API: Change Texture/material
 var version = '1.10.4';
 var uid = '4a023c30f5584baeac5c1d680e8ff988'; // negro
/*  var uid = 'c5fd409594e547f598b3ae0f8efdf0a3'; */ // rojo
 var iframe = document.getElementById('api-frame');
 var client = new window.Sketchfab(version, iframe);
 var canvas = document.createElement('canvas');
 var ctx = canvas.getContext('2d');
 canvas.width = 2;
 canvas.height = 2;
 var myMaterials;

 const rossoImg = `
 data:image/jpeg;base64,
 `
 const neroImg = `
    data:image/jpeg;base64,
 `
 const metalic = `
 data:image/jpeg;base64,
 `
 const normal = `
    data:image/jpeg;base64,
 `
 const roughness = `
    data:image/jpeg;base64,
 `
 const high_nero = `
    data:image/jpeg;base64,
 `
 const high_rosso = `
    data:image/jpeg;base64,
 `
 const high_metalic = `
    data:image/jpeg;base64,
 `
 const high_normal = `
    data:image/jpeg;base64,
 `
 const high_roughness = `
 data:image/jpeg;base64,
 `
const baseColor = `
 data:image/jpeg;base64,
`
 var error = function error() {
    console.error('Sketchfab API error');
  };
 
 var success = function success(api) {
   api.start(function () {
     api.addEventListener('viewerready', function () {
       api.getMaterialList(function (err, materials) {
         myMaterials = materials[0];
       });
     });
   });
   (function () {
     var button = document.getElementById('nero');
     button.addEventListener('click', function () {
       let newTexture = {
         img: neroImg,
         name: "negro",
         uid: null
       };
       api.addTexture(newTexture.img, (error, uid) => {
         newTexture.uid = uid;
 
           myMaterials.channels.AlbedoPBR.texture = {
             uid: newTexture.uid,
           };
 
         api.setMaterial(myMaterials, () => console.log(newTexture));
        })
     });
   })();
   (function () {
     var button = document.getElementById('rosso');
     button.addEventListener('click', function () {
       let newTexture = {
         img: rossoImg,
         name: "rojo",
         uid: null
       };
       api.addTexture(newTexture.img, (error, uid) => {
         newTexture.uid = uid;
 
           myMaterials.channels.AlbedoPBR.texture = {
             uid: newTexture.uid,
           };
 
         api.setMaterial(myMaterials, () => console.log(newTexture));
        })
     });
   })();
   (function () {
    var button = document.getElementById('normal');
    button.addEventListener('click', function () {
      let newTexture = {
        img: normal,
        name: "rojo",
        uid: null
      };
      api.addTexture(newTexture.img, (error, uid) => {
        newTexture.uid = uid;

          myMaterials.channels.AlbedoPBR.texture = {
            uid: newTexture.uid,
          };

        api.setMaterial(myMaterials, () => console.log(newTexture));
       })
    });
  })();
  (function () {
    var button = document.getElementById('metalic');
    button.addEventListener('click', function () {
      let newTexture = {
        img: metalic,
        name: "rojo",
        uid: null
      };
      api.addTexture(newTexture.img, (error, uid) => {
        newTexture.uid = uid;

          myMaterials.channels.AlbedoPBR.texture = {
            uid: newTexture.uid,
          };

        api.setMaterial(myMaterials, () => console.log(newTexture));
       })
    });
  })();
  (function () {
    var button = document.getElementById('roughness');
    button.addEventListener('click', function () {
      let newTexture = {
        img: roughness,
        name: "rojo",
        uid: null
      };
      api.addTexture(newTexture.img, (error, uid) => {
        newTexture.uid = uid;

          myMaterials.channels.AlbedoPBR.texture = {
            uid: newTexture.uid,
          };

        api.setMaterial(myMaterials, () => console.log(newTexture));
       })
    });
  })();
  (function () {
    var button = document.getElementById('high_nero');
    button.addEventListener('click', function () {
      let newTexture = {
        img: baseColor,
        name: "rojo",
        uid: null
      };
      api.addTexture(newTexture.img, (error, uid) => {
        newTexture.uid = uid;

          myMaterials.channels.AlbedoPBR.texture = {
            uid: newTexture.uid,
          };

        api.setMaterial(myMaterials, () => console.log(newTexture));
       })
    });
  })();
 };
 
 
 client.init(uid, {
   success: success,
   error: error,
   autostart: 1,
   preload: 1,
   ui_fadeout: 0,
   ui_fullscreen: 0,
   ui_settings: 0,
   ui_help: 0,
   ui_inspector: 0,
   ui_vr: 0,
   ui_ar: 0,
 });